// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';

// Import Admin Components
import AdminDashboard from './pages/admin/AdminDashboard';
import AdminExpensesPage from './pages/admin/ExpensesPage';
import AdminComplaintsPage from './pages/admin/ComplaintsPage';
import AdminNotificationsPage from './pages/admin/NotificationsPage';

// Import Member Components
import MemberDashboard from './pages/member/MemberDashboard';
import MemberExpensesPage from './pages/member/ExpensesPage';
import MemberComplaintsPage from './pages/member/ComplaintsPage';
import MemberNotificationsPage from './pages/member/NotificationsPage';

// Import CSS
import './App.css';

function App() {
  return (
    <Router>
      <div className="app">
        <Routes>
          {/* Default route - redirect to admin dashboard */}
          <Route path="/" element={<Navigate to="/admin" replace />} />
          
          {/* Admin Routes */}
          <Route path="/admin" element={<AdminDashboard />} />
          <Route path="/admin/dashboard" element={<AdminDashboard />} />
          <Route path="/admin/expenses" element={<AdminExpensesPage />} />
          <Route path="/admin/complaints" element={<AdminComplaintsPage />} />
          <Route path="/admin/notifications" element={<AdminNotificationsPage />} />
          
          {/* Member Routes */}
          <Route path="/member" element={<MemberDashboard />} />
          <Route path="/member/dashboard" element={<MemberDashboard />} />
          <Route path="/member/expenses" element={<MemberExpensesPage />} />
          <Route path="/member/complaints" element={<MemberComplaintsPage />} />
          <Route path="/member/notifications" element={<MemberNotificationsPage />} />
          
          {/* 404 Page */}
          <Route 
            path="*" 
            element={
              <div style={{
                display: 'flex',
                flexDirection: 'column',
                justifyContent: 'center',
                alignItems: 'center',
                height: '100vh',
                textAlign: 'center',
                fontFamily: 'Arial, sans-serif'
              }}>
                <h1 style={{ fontSize: '48px', color: '#e74c3c', marginBottom: '16px' }}>404</h1>
                <h2 style={{ fontSize: '24px', color: '#2c3e50', marginBottom: '16px' }}>Page Not Found</h2>
                <p style={{ fontSize: '16px', color: '#7f8c8d', marginBottom: '24px' }}>
                  The page you're looking for doesn't exist.
                </p>
                <button 
                  onClick={() => window.history.back()}
                  style={{
                    padding: '12px 24px',
                    backgroundColor: '#3498db',
                    color: 'white',
                    border: 'none',
                    borderRadius: '6px',
                    fontSize: '14px',
                    cursor: 'pointer',
                    transition: 'background-color 0.3s ease'
                  }}
                  onMouseOver={(e) => e.target.style.backgroundColor = '#2980b9'}
                  onMouseOut={(e) => e.target.style.backgroundColor = '#3498db'}
                >
                  Go Back
                </button>
              </div>
            } 
          />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
